    return(
        <tr key={row.id}>
        <td>{row.dateRefund}</td>
        <td>{row.type}</td>
        <td>{row.amount}</td>
        <td>{row.ticket}</td>
        <td>{row.state}</td>
        <td>{row.refund}</td>
        <td></td>
    </tr>
    )
}
